    var getNumber = function(event)
    {
      if (event.event.which !== 1) return;
      if (spinning) return;

      if (tokens == 0) {
          info(lang('noTokens'));
          return;
      } 
      if (bets.length == 0) {
          info(lang('makeabet'));
          return;
      }
      removeButtonEvents();
      coneLoopSound = soundit('coneloop');
      info(lang('holdYourBreath'));
      betsBak = bets.slice();
      var data = {'sid': 'roulettePlay', 'step': 'processStakes', 'mode': 'html'};
      for (var bet in bets) {
          data['stake' + bet] = params.betTypes[bets[bet]['type']] + '-' + bets[bet]['betid'] + '-' + bets[bet]['stake'];
      }
      getAction({
         data: data,
         success: function(data){
            var response = JSON.parse(data);
            if (response.error) {
                info(response.error, 'red');
                return;
            }
            theN = response.number;
            if (isNaN(theN)) {
                info("Didn't get proper response, please refresh this page and try again.", 'red');
                return;
            }
            moneyAmount = response.totalAmount;
            won = response.won;
            tokens = response.tokens;
            winNumbers = response.winNumbers;
            drawWinNumbers();
            fall();
        },   
        error:function(jqXHR, msg, errorThrown )
        {
           //theN = Math.round(Math.random() * 36)
           info('<span>Network error, please make sure you are online.</span>');
           //fall();
        }
      });
      spin();
      fillBallProps = true;
    };

