    var updateWheelPosition = function()
    {
        if (wheel.angVel >= params.wheelMaxVel)
        {
             wheel.angAcc = 0; //remove force
        }
        else if (wheel.angVel <= params.wheelMinVel && wheel.angAcc == 0)
        {
            wheel.wheelFriction = 0;
            wheel.angAcc = 0;
        }
        wheel.angVel += wheel.angAcc - wheel.wheelFriction;
        wheel.rotate(wheel.angVel);
    };

    var updateBallPosition = function()
    {

        if (!spinning) return;
        if (!ballSynched)
        {
            if1 = 1;
            ball.position.angle -= ball.velInRad;
            if (startSyncBall && !ballSynched)
            {    
                if2 = 1;
                var ballWheelAng = angleModulo(ball.position.angle) % params.oneSlot;
                if (ballWheelAng < .5)
                {
                    ballSynched = true;
                    var slotIndex = Math.floor(angleModulo(ball.position.angle) / params.oneSlot);
                    
                    ball.position = new Point({ length: params.ball0Orbit, angle: (slotIndex * params.oneSlot) });
                    syncAngle = ball.position.angle;
                    var fallToIndex = getSlotIndex(theN);
                    var distance = fallToIndex - slotIndex;
                    if (distance < 0) distance += 37;
                    currentPositions = params.positions[distance];
                    cpCount = currentPositions.length;
                    p = 0;
                }
            }
            return;
        }

        ball.position.x = currentPositions[p][0];
        ball.position.y = currentPositions[p][1];
        ball.position.angle += syncAngle;
        ball.z = currentPositions[p][2];

        adjustBallZ();
        if (currentPositions[p][3] == 1) {
            var volume = 80 - 1.5 * hit;
            if (volume < 20) volume = 20;
            soundit('hit' + (hit % 10), volume);
            hit++;
            if (!coneLoopStoped) {
                coneLoopSound && coneLoopSound.fadeOut(1000, function () { coneLoopSound.stop(); });
                coneLoopStoped = true;                  
            }
        }
        p++;
        if (  p == cpCount - 100 ){
            clearBets();
            setStats();
            addButtonEvents();
            markWonNumber();
            checkChips();
            setTimeout(clearWinNumbers, 1000);
        } else if ( p == cpCount ){
            spinning = startSyncBall = false;

            // see if it's a right place
            slotIndex = Math.floor(angleModulo(ball.position.angle) / params.oneSlot);
            if ( params.slotNumbers[slotIndex] !== theN ) {
               
                getAction({ type:"POST",
                            data: {
                            'sid': 'roulettePlay', 
                            'step':'error', 
                            'expected': theN, 
                            'fellTo': params.slotNumbers[slotIndex] } 
                        });

                var homeAngle = getSlotIndex(theN) * params.oneSlot + params.oneSlot / 2 ;
                var start = ball.position.angle
                if (homeAngle - start > 180) start += 360;
                new TWEEN.Tween( { angle: start} )
                   .to( { angle: homeAngle}, 2000 )
                  .easing( TWEEN.Easing.Cubic.Out )
                   .onUpdate( function () {
                      ball.position.angle = this.angle;
                   } )
                   .start();    
            }
        }
        return;

       
    };

