    {
        ball.rotate(-wheel.angVel)
    };

    
    var initBall = function()
    {
        ball.position = new Point(params.ball0Orbit, 0);
        ball.vel0 = 5.18;
        ball.velInRad = 2 * Math.asin(ball.vel0 / (2 * ball.position.length)) * params.radToDeg;
        ball.z = 0;      
        ball.zVel = 0; 
        ballSynched = false;
        coneLoopStoped = false;
        hit = 0;
        resultsShown = false;
    };

