    var drawWinNumbers = function()
    {
      var markSource = [[70,0], [85,0], [84,13], [69,11]];
      markGroup = new Group();
      wheel.insertChild(1,markGroup);
      for (var n in winNumbers) {
         var angle = -360/37 * getSlotIndex(winNumbers[n]);
         var mark = new Path();
         for (var p in markSource)
         {
            mark.add(getCoo(new Point(markSource[p]), angle * (Math.PI / 180)));
         }
         mark.fillColor = new Color(.21, .85, 0, .5);
        
         markGroup.addChild(mark)
      }
    };
    
    function getCoo(point, angle)
    {
        var x =  point.x * Math.cos(angle) + point.y * Math.sin(angle);
        var y = -point.x * Math.sin(angle) + point.y * Math.cos(angle);
        return new Point(x,y);
    };
    
    var clearWinNumbers = function()
    {
        markGroup.remove();
    };
    
    var lang = function(langID, args)
    {
        var result = langObj['roulette.' + langID]
        if (result)
        {
            result = result.replace(/\{(\w+)\}/g, function(m, p1) {
                return args[p1];
            });
        }
        else
        {
            result = langID
        }
        return  result;
    };

    //$.when(loadLangs(), loadUserData()).then(initGame);
    $.when(true).then(loadLangs);
    
